import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Button } from 'semantic-ui-react';

export default class Test extends Component {
    render() {
        return (
            <div style={{
                marginBottom:'5000px'
            }}>
                <Link to='/'><Button>click to go back</Button></Link>
                
            </div>
        );
    }
}
